/********************************/
/*   about:blank - Walking Man  */
/********************************/
/*      By kurzweilig           */
/********************************/

@-moz-document url("about:blank") {

@-moz-keyframes walk {
0% {left: -188px}
100% {left: 100%}
}

BODY:before {
  content: "";
  position: fixed; width: 188px; height: 294px;
  top: -moz-calc(50% - 294px / 2); 
  left: -moz-calc(50% - 188px / 2);
  -moz-animation: walk 10s -5s linear infinite;
  background: url("data:image/gif;base64,");
}

}
